INSERT INTO `fg_settings` VALUES (1, '<b>text of news</b><br/> text of news <br/><i>text of news</i> <br/>text of news text of news text of news text of news text of news text of news text of news text of news text of news text of news ', '1', '<p><strong>THIS PAGE IS CURRENTLY UNDER CONSTRUCTION TILL JUNE 06<br /><br />1967<br /></strong>Eine Gruppe von renommierten Modefotografen gr&uuml;nden eine Genossenschaft zu Vermittlung und Aufbau von Fotomodellen. Der Name der Firma entsteht durch die Abk&uuml;rzung von &bdquo;FOTOGRAFEN-GENOSSENSCHA FT.</p><p>Das ist ein Test<br /><br /><strong>1979<br /></strong>Die damalige Gesch&auml;ftsf&uuml;hrung kauft alle Anteile der Fotografen auf, und wandelt die <br />Genossenschaft in eine Aktiengesellschaft um. <br /><br /><strong>1994<br /></strong>Fotogen wird an jungen innovativen Gesellschafter verkauft. FACE2FACE, eine bestehende Firma, die in der Vermittlung von Haar, Make-Up und Styling Artisten t&auml;tig ist, wird aufgekauft, und der bisherigen T&auml;tigkeit der Fotogen hinzugef&uuml;gt. Eine eigenst&auml;ndige &bdquo;Scouting Abteilung&ldquo; wird er&ouml;ffnet, die weltweit Mitarbeiter anstellt, deren Aufgabe die Suche und der Aufbau neuer Modelle ist. Fotogen wird international wettbewerbsf&auml;hig.<br /><br /><strong>2000<br /></strong>Fotogen Entertainment wird ins Leben gerufen. Diese Abteilung ist f&uuml;r die Durchf&uuml;hrung innovativer Events, sowie die Erstellung Kundenorientierter Konzepte zust&auml;ndig. Eigene Modellwettbewerbe und Events werden in Zukunft durch diese Abteilung geplant und organisiert.<br /><br /><strong><img style="width: 120px; height: 183px" src="../uploaded_imgs/history.jpg" alt="history" title="history" width="120" height="183" align="left" />2004<br /></strong>Immer h&auml;ufiger werden authentische Modelle in der Werbung eingesetzt. Um die Erweiterung unseres Angebotes zu gew&auml;hrleisten, wird eine weitere Abteilung er&ouml;ffnet, die sich mit der Vermittlung von &bdquo;PEOPLE Modellen&ldquo; auseinandersetzt. Eine Fotogen Schule wird in Zukunft Teenager die diversen Praktiken im Bereich Haare, Make-Up, und Styling, Ern&auml;hrung und Fitness beibringen. Fotoshootings, sowie Catwalkstunden werden Teenagern zu g&uuml;nstigen Konditionen ebenso zug&auml;nglich gemacht.<br /><br />FOTOGEN ist heute als f&uuml;hrende Agentur der Schweiz anerkannt und z&auml;hlt international zu den renommierten Modellagenturen.<br /><br /><br /><br /><strong><br />E-MAIL ADRESSEN:</strong><br /><br /><a href="mailto:office@fotogen.ch" target="_blank" title="office email">Office@fotogen.ch</a><br /><a href="mailto:Woman@fotogen.ch">Woman@fotogen.ch</a><br /><a href="mailto:Man@fotogen.ch">Man@fotogen.ch</a></p>', '<img style="width: 300px; height: 200px" src="../uploaded_imgs/today.jpg" alt="today" title="today" width="300" height="200" align="right" />Fotogen besteht heute aus folgenden Abteilungen:<br /><br /><strong>FOTOGEN Modells<br /></strong>Vermittlung von weiblichen und m&auml;nnlichen nationalen und internationalen Fotomodellen<br /><br /><strong>FOTOGEN People</strong> <br />Vermittlung von weiblichen und m&auml;nnlichen Personen f&uuml;r Werbeauftr&auml;ge<br /><br /><strong>Face 2Face<br /></strong>Vermittlung von nationalen und internationalen Haar, Make Up sowie Styling Artisten<br /><br /><strong>FOTOGEN Casting <br /></strong>Weltweit engagierte Mitarbeiter stehen zur Verf&uuml;gung, Castings in diversen L&auml;ndern durchzuf&uuml;hren. <br /><br /><strong>FOTOGEN Entertainment</strong> <br />Planung, Organisation und Durchf&uuml;hrung von eigenen sowie kundenorientierten Veranstaltungen<br /><br /><strong>FOTOGEN Schule</strong><br />Schulung von Teenager in den bereichen Haare, make Up Styling, Ern&auml;hrung, Fitness, Fotografie, Catwalk', '<p>todo: rewrite image below to editable&nbsp;text<br /><br /><em><img style="width: 594px; height: 215px" src="../uploaded_imgs/termstextfotogen.jpg" alt="desc" title="desc" width="594" height="215"